import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { FiLogIn, FiUserPlus, FiHome, FiLayers, FiLogOut } from "react-icons/fi";

function Home() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (token) {
      setIsLoggedIn(true);
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-white shadow-lg p-5 flex flex-col">
        <h2 className="text-2xl font-bold text-purple-600 mb-6 flex items-center">
          <FiLayers className="mr-2" />  Virtual Time Bank
        </h2>
        <nav className="flex flex-col space-y-4">
          <button onClick={() => navigate("/")} className="flex items-center p-3 rounded-lg hover:bg-blue-100">
            <FiHome className="mr-3" /> Home
          </button>
          {!isLoggedIn ? (
            <>
              <button onClick={() => navigate("/login")} className="flex items-center p-3 rounded-lg hover:bg-blue-100">
                <FiLogIn className="mr-3" /> Login
              </button>
              <button onClick={() => navigate("/signup")} className="flex items-center p-3 rounded-lg hover:bg-blue-100">
                <FiUserPlus className="mr-3" /> Sign Up
              </button>
            </>
          ) : (
            <>
              <button onClick={() => navigate("/dashboard")} className="flex items-center p-3 rounded-lg hover:bg-blue-100">
                <FiLayers className="mr-3" /> Dashboard
              </button>

              <button onClick={() => navigate("/dashboard")} className="flex items-center p-3 rounded-lg hover:bg-blue-100">
                <FiLayers className="mr-3" /> Explore
              </button>


              <button onClick={handleLogout} className="flex items-center p-3 text-red-600 rounded-lg hover:bg-red-100">
                <FiLogOut className="mr-3" /> Logout
              </button>
            
              
            </>
          )}
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Navbar */}
        <div className="bg-white shadow p-4 flex justify-between items-center">
          <h2 className="text-2xl font-semibold text-purple-600">Welcome</h2>
          <div className="flex space-x-4">
            {!isLoggedIn ? (
              <>
                <button onClick={() => navigate("/login")} className="px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition">
                  Login
                </button>
                <button onClick={() => navigate("/signup")} className="px-4 py-2 bg-purple-600 text-white rounded-lg hover:bg-purple-700 transition">
                  Sign Up
                </button>
              </>
            ) : (
              <button onClick={() => navigate("/dashboard")} className="px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition">
                Go to Dashboard
              </button>
            )}
          </div>
        </div>

        {/* Hero Section */}
        <div className="flex flex-col items-center justify-center h-[calc(100vh-64px)] text-center px-6">
          <h2 className="text-4xl font-bold mb-4 animate-fade-in">Welcome to the Virtual Time Bank</h2>
          <p className="text-lg mb-6 max-w-lg">Exchange your skills and earn time credits! Join our community and start saving time today.</p>
          <button onClick={() => navigate("/signup")} className="px-6 py-3 bg-blue-600 text-white font-semibold rounded-full shadow-md hover:bg-blue-700 transition">
            Get Started
          </button>
        </div>
      </div>
    </div>
  );
}

export default Home;
